import React from 'react';
import logo from '../logo.svg';

class Home extends React.Component{
  render(){
    if(localStorage.getItem('email') == null){
      return(
        <div className='text-center text-white'>
          <h1>Welcome</h1>
          <img src={logo} className="App-logo" alt="logo" />
          <h2>To get started, please login or register for an account.</h2>
          <br></br><br></br>
        </div>

      );
    }else{
      return(
        <div className='text-center text-white'>
          <h1>Welcome</h1>
          <img src={logo} className="App-logo" alt="logo" />
          <h2>You are logged in as {localStorage.getItem('firstname') + " " + localStorage.getItem('lastname')}</h2>
          <br></br><br></br>
        </div>

      );
    }

  }
}

export default Home;
